%spark
// TODO print a log of the performance of training over time - see if it overfit
print ("%table ")
import scala.io.Source

val source = Source.fromFile("/data/training.csv")
println("log\tindex\tepoch	iteration	Train Accuracy	Test Accuracy	Validation Accuracy")
var idx = 0
for (line <- source.getLines()) {
    try {
        val columns = line.split("\t")

        if (columns.length == 5) {
            println(
                "\t" +
                idx + "\t" +
                columns(0) + "\t" +
                columns(1) + "\t" +
                columns(2) + "\t" +
                columns(3) + "\t" +
                columns(4)
            )
        }

        idx = idx + 1
    } catch {
        case _: Throwable => {}
    }
}
